// src/App.js

import React from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom"; // Change Switch to Routes
import Pokemon from "./Components/Pokemon/Pokemon";
import Trainer from "./Components/Trainer/Trainer";
import * as Env from "./environment";
import Parse from "parse";

// Initialize Parse with your credentials
Parse.initialize(Env.APPLICATION_ID, Env.JAVASCRIPT_KEY);
Parse.serverURL = Env.SERVER_URL;

function App() {
  return (
    <Router>
      <nav>
        <Link to="/">Pok√©mon</Link>
        <Link to="/trainer">Trainer</Link>
      </nav>
      <Routes> {/* Replace Switch with Routes */}
        <Route path="/" element={<Pokemon />} /> {/* Update to use element prop */}
        <Route path="/trainer" element={<Trainer />} /> {/* Update to use element prop */}
      </Routes>
    </Router>
  );
}

export default App;
